import React from 'react';
import mo88i from './assets/mo88iCircleIcon.webp';
import profileImg from './assets/profile_big.webp';
import menu1 from './assets/menu1.webp';
import menu2 from './assets/menu2.webp';
import menu3 from './assets/menu3.webp';
import menu4 from './assets/menu4.webp';
import banner from './assets/banner.webp';
import './App.css';

const App =()=> {
  return (
    <div className="App-header">
      <div className="App-body">
        <div className="Container-welcome">
          <img src={profileImg} className='Photo-circle'/>
          <b className='Text-title'>Hi, Techbox</b>
        </div>
        <img src={banner} className='Container-hero'/>

        <div className='Container-menu-buttons'>
          <div className='Container-button-menu'>
            <img className='Button-menu' src={menu1}/>
            Schedule
          </div>
          <div className='Container-button-menu'>
            <img className='Button-menu' src={menu2}/>
          </div>
          <div className='Container-button-menu'>
            <img className='Button-menu' src={menu3}/>
          </div>
          <div className='Container-button-menu'>
            <img className='Button-menu' src={menu4}/>
          </div>
        </div>

        <div className='Border-line'/>

        <div className="Container-welcome">
          <b className='Text-promo'>Promo</b>
        </div>
      </div>
    </div>
  );
}

export default App;
